import React, { Component } from 'react';
import { Dialog, Card } from '@blueprintjs/core';

export default class UserDialog extends Component {
   render() {
      return (
         <Dialog
            isOpen={this.props.isOpen}
            onClose={() => this.toggle()}
            toggle={() => this.toggle()}
         >
            <Card>
               <div id={this.props.id}>{this.props.children}</div>
            </Card>
         </Dialog>
      );
   }
}
